import React from "react";
import "../styles/teamPage.css";
import Navbar from "../components/Navbar";

import kapMembers from "../assets/kapMembers.png";
import kap from "../assets/kap.jpg";
import april from "../assets/april.png";
import lalain from "../assets/lalain.png";
import harold from "../assets/harold.png";
import jovic from "../assets/jovic.png";
import thomas from "../assets/thomas.png";
import antonio from "../assets/antonio.png";
import gabriel from "../assets/gabriel.png";
import precy from "../assets/precy.png";
import ruel from "../assets/ruel.png";

function TeamPage() {
    return (
        <div className="teamPage">
            <Navbar />
            
            {/* Header Section */}
            <div className="teamHeader">
                <h1 className="teamTitle">Sangguniang Barangay</h1>
                <h2 className="teamSubtext">Leaders Committed to Community Service</h2>
                <p className="teamDesc">
                    The Sangguniang Barangay is dedicated to governing and improving our community.
                    Through leadership, transparency, and service, we ensure the well-being and development of our barangay.
                </p>
            </div>

            {/* Main Group Image */}
            <div className="kapMembersContainer">
                <img src={kapMembers} alt="Kapitan and Kagawads" className="kapMembers" />
            </div>

            {/* Barangay Chairman Section */}
            <div className="barangayChairman">
                <img src={kap} alt="Barangay Chairman" className="chairmanImage" />
                <p className="chairmanName">Hon. Andrea Amor "AA" D. Mercado</p>
                <p className="chairmanTitle">Barangay Chairwoman</p>
            </div>

            {/* Barangay Council Members */}
            <div className="teamMembersGrid">
                {/* Row 1 - 2 Members */}
                <div className="teamRow">
                    <div className="teamMember"><img src={april} alt="April B. Santos" /><p className="teamMemberName">April B. Santos</p><p className="teamMemberTitle">Secretary</p></div>
                    <div className="teamMember"><img src={lalain} alt="Lalaine M. Del Corro" /><p className="teamMemberName">Lalaine M. Del Corro</p><p className="teamMemberTitle">Treasurer</p></div>
                </div>
                
                {/* Row 2 - 3 Members */}
                <div className="teamRow">
                    <div className="teamMember"><img src={harold} alt="Harold V. Morata" /><p className="teamMemberName">Harold V. Morata</p><p className="teamMemberTitle">Committee on BDRRM & Sanitation</p></div>
                    <div className="teamMember"><img src={thomas} alt="Thomas O. Binarao" /><p className="teamMemberName">Thomas O. Binarao</p><p className="teamMemberTitle">Committee on Human Rights, Law & Justice</p></div>
                    <div className="teamMember"><img src={jovic} alt="Jovic B. Palompon" /><p className="teamMemberName">Jovic B. Palompon</p><p className="teamMemberTitle">Committee on Appropriation, Health & Religion</p></div>
                </div>
                
                {/* Row 3 - 3 Members */}
                <div className="teamRow">
                    <div className="teamMember"><img src={antonio} alt="Antonio C. Aguilar" /><p className="teamMemberName">Antonio C. Aguilar</p><p className="teamMemberTitle">Committee on Education, ALS & Business Programs</p></div>
                    <div className="teamMember"><img src={precy} alt="Precy G. Lopez" /><p className="teamMemberName">Precy G. Lopez</p><p className="teamMemberTitle">Committee on Clean & Green / Beautification</p></div>
                    <div className="teamMember"><img src={ruel} alt="Ruel A. Buan" /><p className="teamMemberName">Ruel A. Buan</p><p className="teamMemberTitle">Committee on Public Works & Infrastructure / Livelihood</p></div>
                </div>
                
                {/* Row 4 - 1 Member */}
                <div className="teamRow">
                    <div className="teamMember"><img src={gabriel} alt="Gabriel P. Fortun" /><p className="teamMemberName">Gabriel P. Fortun</p><p className="teamMemberTitle">Committee on Peace & Order / IDADAIT VAWC / Senior, PWD & Single Parent</p></div>
                </div>
            </div>
        </div>
    );
}

export default TeamPage;
